query: |-
  SELECT
      c.customer_id AS customer_id,
      c.first_name,
      c.last_name,
      COUNT(o.order_id) AS order_count
  FROM
      jaffle_shop.customers c
  LEFT JOIN
      jaffle_shop.orders o
  ON c.customer_id = o.customer_id
  GROUP BY
      c.customer_id, c.first_name, c.last_name
  ORDER BY
      order_count DESC;
